//ways to write functions in typescript
//1. regular function
function add(a, b) {
    return a + b;
}
console.log(add(1, 2));
//anonymous function
var add2 = function (a, b) {
    return a + b;
};
console.log(add2(1, 2));
//arrow function
var add3 = function (a, b) {
    return a + b;
};
console.log(add3(1, 2));
var power = function (a) {
    return a * a;
};
var power2 = function (a) { return a * a; };
var power3 = function (a) { return a * a; };
